package com.xinyan.mms.materials.pojo;public class Statusp {    private String materials_status;    private String materials_coding;    @Override    public String toString( ) {        return "Statusp{" +                "materials_status='" + materials_status + '\'' +                ", materials_coding='" + materials_coding + '\'' +                '}';    }    public String getMaterials_coding( ) {        return materials_coding;    }    public void setMaterials_coding( String materials_coding ) {        this.materials_coding = materials_coding;    }    public String getMaterials_status( ) {        return materials_status;    }    public void setMaterials_status( String materials_status ) {        this.materials_status = materials_status;    }}